import React from "react";
import PropTypes from "prop-types";

function Navbar() {
  const defaultProps = {
    title: "Github Finder",
    icon: "fab fa-github"
  };

  const propTypes = {
    title: PropTypes.string.isRequired,
    icon: PropTypes.string.isRequired
  };

  return (
    <nav className=" navbar bg-danger">
      <h1>
        <i className={this.props.icon} />
        {this.props.title}
      </h1>
    </nav>
  );
}

export default Navbar;
